    data: |
      SELECT - col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col2 BETWEEN + CAST ( NULL AS INTEGER ) AND - col1;
  - name: tab2

outputs:
  - name: q11432.out
    data: |
      -46
      -64
      -75
